        static IEnumerable<TestCase<double, double, double>> GetBetaData(Data7[] data)
        {
            return data.Select(d => TestCase.Create(d.A, d.B, d.X, d.Beta));
        }

        static IEnumerable<TestCase<double, double, double>> GetBetacData(Data7[] data)
        {
            return data.Select(d => TestCase.Create(d.A, d.B, d.X, d.Betac));
        }

        static IEnumerable<TestCase<double, double, double>> GetIBetaData(Data7[] data)
        {
            return data.Select(d => TestCase.Create(d.A, d.B, d.X, d.Ibeta));
        }

        static IEnumerable<TestCase<double, double, double>> GetIBetacData(Data7[] data)
        {
            return data.Select(d => TestCase.Create(d.A, d.B, d.X, d.Ibetac));
        }

        [TestMethod]
        public void Beta2Test()
        {

            Assert2.AreEqual<Exceptions.DomainException>(double.NaN, () => Math2.Beta(0, 2, 0.5));
            Assert2.AreEqual<Exceptions.DomainException>(double.NaN, () => Math2.Beta(3, 0, 0.5));

            TestCaseSet<double, double, double>[] testCases = {
                new TestCaseSet<double,double,double>(GetBetaData(_BetaAdd),"Incomplete Beta Function: Added Values",90), 
                new TestCaseSet<double,double,double>(GetBetaData(_IbetaSmallData),"Incomplete Beta Function: Small Values",90), 
                new TestCaseSet<double,double,double>(GetBetaData(ibeta_data), "Incomplete Beta Function: Medium Values", 200),
                new TestCaseSet<double,double,double>(GetBetaData(_IbetaIntData), "Incomplete Beta Function: Small Integer Values", 90),
                new TestCaseSet<double,double,double>(GetBetaData(_IbetaLargeData), "Incomplete Beta Function: Large and Diverse Values", 5000),
                new TestCaseSet<double,double,double>(GetBetaData(_IbetaAddData), "Incomplete Beta Function: Small Argument", 200)
            };

            NumericFunctionTest.RunSet(Math2.Beta, "Beta", testCases);

        }


        [TestMethod]
        public void Beta2cTest()
        {

            Assert2.AreEqual<Exceptions.DomainException>(double.NaN, () => Math2.Betac(0, 2, 0.5));
            Assert2.AreEqual<Exceptions.DomainException>(double.NaN, () => Math2.Betac(4, 0, 0.5));

            TestCaseSet<double, double, double>[] testCases = {
                new TestCaseSet<double,double,double>(GetBetacData(_BetaAdd),"Incomplete Beta Function: Added Values",90), 
