        [TestMethod]
        public void IbetaTest()
        {

            Assert.AreEqual(1, Math2.Ibeta(0, 2, 0.5));
            Assert.AreEqual(0, Math2.Ibeta(3, 0, 0.5));

            TestCaseSet<double, double, double>[] testCases = {
                new TestCaseSet<double,double,double>(_IbetaSpots,"Incomplete Beta Function: Spots",500), 
