        }

        [TestMethod]
        public void IbetacTest()
        {

            Assert.AreEqual(0, Math2.Ibetac(0, 2, 0.5));
            Assert.AreEqual(1, Math2.Ibetac(4, 0, 0.5));
            Assert2.AreEqual<Exceptions.DomainException>(double.NaN, () => Math2.Ibetac(0, 0, 0.5));
            Assert2.AreEqual<Exceptions.DomainException>(double.NaN, () => Math2.Ibetac(-1, 2, 0.5));
            Assert2.AreEqual<Exceptions.DomainException>(double.NaN, () => Math2.Ibetac(2, -2, 0.5));
            Assert2.AreEqual<Exceptions.DomainException>(double.NaN, () => Math2.Ibetac(2, 2, -0.5));
            Assert2.AreEqual<Exceptions.DomainException>(double.NaN, () => Math2.Ibetac(2, 2, 1.5));


            TestCaseSet<double, double, double>[] testCases = {
                new TestCaseSet<double,double,double>(_IbetacSpots,"Incomplete Beta Function: Spots",500), 
                new TestCaseSet<double,double,double>(GetIBetacData(_IbetaSmallData),"Incomplete Beta Function: Small Values",90), 
                new TestCaseSet<double,double,double>(GetIBetacData(ibeta_data), "Incomplete Beta Function: Medium Values", 200),
                new TestCaseSet<double,double,double>(GetIBetacData(_IbetaIntData), "Incomplete Beta Function: Small Integer Values", 350),
                new TestCaseSet<double,double,double>(GetIBetacData(_IbetaLargeData), "Incomplete Beta Function: Large and Diverse Values", 3100), // 3000
                new TestCaseSet<double,double,double>(GetIBetacData(_IbetaAddData), "Incomplete Beta Function: Small Argument", 200)
            };

            NumericFunctionTest.RunSet(Math2.Ibetac, "Ibetac", testCases);

        }


        [TestMethod]
        public void IbetaDerivativeTest()
        {

            // very naive check on derivative:
            Assert2.AreNear(Math2.IbetaDerivative(2, 3, 0.5), Math.Pow(0.5, 2) * Math.Pow(0.5, 1) / Math2.Beta(2, 3), 100);
            Assert2.AreNear(Math2.IbetaDerivative(3, 2.5, Math.Pow(2, -997)), 1.0974360368433693011226006323421379092782470715809e-599, 100);
            Assert2.AreNear(Math2.IbetaDerivative(3, 2.5, Math.Pow(2, -500)), 1.8373627489282121680117387911750150526836487850443e-300, 500);
            Assert2.AreNear(Math2.IbetaDerivative(1.0 / 8, 1.0 / 2.0, Math.Pow(2, -1024)), 5.6752524917564824873263137935331178148574281642768e268, 500);

        }


